import React from 'react';
// const currentHeight =() =>{
//     var height = '767px';
//     return (height)
// }

const Scroll = (props) => {
    return (
        <div style={{ overflow:'scroll',height:'767px'}}>
            {props.children}
            
        </div>
    )
}
export default Scroll;
